To sort a dictionary by key in JavaScript, you can use a function that creates a new object from the original one while ordering it alphabetically by keys. Here is an example:

```javascript
function sortDictByKeys(obj) {
    return Object.keys(obj).sort().reduce((acc, curr) => {
        acc[curr] = obj[curr];
        return acc;
    }, {});
}

// Usage
let myDict = {
    c: 10,
    b: 5,
    a: 3
};

console.log(sortDictByKeys(myDict)); // Outputs: {a: 3, b: 5, c: 10}
```

In the above example, `Object.keys()` is used to get all the keys of the object and `sort()` is used to sort them in alphabetical order. Then `reduce()` is used to create a new dictionary with keys sorted in alphabetical order.
